import React, {Component} from 'react';
import Table from './table';

class App extends Component {
	render() {

		const characters = [
			{
				'name': 'Morten',
				'job': 'Creative Technologist'
			},
			{
				'name': 'Mac',
				'job': 'Janitor'
			},
			{
				'name': 'Dennis',
				'job': 'Artist'
			},
			{
				'name': 'Julia',
				'job': 'Truck driver'
			}
		];

		return (
			<div className="container">
				<Table characterData={characters} />
			</div>
		);
	}
}

export default App;
